import React from 'react';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
   console.log("-------------",this.props.weather)
   if (!props.weather) {
     return 'Loading...'
   }
  return (
    <Card>
        <Card.Body>
          {this.props.weather.base}
        </Card.Body>
    </Card>
  );
}

export default CurrentWeather;
